syntax = "proto3";
package cosmos.std.v1beta1;
import "cosmos/std/v1beta1/tx.proto";
option go_package="x/std/types";

import "gogoproto/gogo.proto";


message GenesisState {
  repeated Student student=1 ;
  repeated AcceptLeaveRequest  acceptleaverequest=2 [(gogoproto.nullable) = false];
  repeated ApplyLeaveRequest applyleaverequest=3 [(gogoproto.nullable) = false];
  repeated RegisterAdminRequest registeradminrequest=4 [(gogoproto.nullable) = false];
 }